import * as dotenv from 'dotenv';
import { Demo } from "../contracts/demo"
import { getDummyUtxo, readArtifact } from '../utils/index.js';
import { ContractHeaderSerializer, DefaultSigner, ExtPsbt, IExtPsbt, bvmVerify } from '../../src/index.js';
import { expect, use } from 'chai';
import chaiAsPromised from 'chai-as-promised';
use(chaiAsPromised);

dotenv.config();

describe('Test Contract Header', () => {

    let testSigner: DefaultSigner;
    let testAddress: string
    let exepctMd5: string

    before(async () => {
        testSigner = new DefaultSigner();
        testAddress = await testSigner.getAddress()
        Demo.loadArtifact(readArtifact('demo.json'));
        exepctMd5 = Demo.artifactHexMD5
    })

    describe('should serialize and deserialize a contract header successfully', () => {
        it('should deserialize successfully if the utxo.script do not have header', () => {
            const demo = new Demo(1n, 2n);
            const txOutScript = (demo as any)._lockingScriptHexWithoutHeader;
            const { header, lockingScript } = ContractHeaderSerializer.deserialize(txOutScript);
            expect(header).to.be.null;
            expect(lockingScript).to.equal(txOutScript);
        })

        it('should deserialize successfully if the utxo.script have header', () => {

            testDeserialize('string', 'string')
            testDeserialize('', 'string long than 520 bytes')
            testDeserialize(23, 'number')
            testDeserialize(0, 'number')
            testDeserialize(-1, 'number')
            testDeserialize(false, 'boolean')
            testDeserialize(true, 'boolean')

            testDeserialize([1, 2, 3], 'array')
            testDeserialize({ a: 1, b: 2 }, 'object')

            function testDeserialize(tag: any, typeStr: string) {
                const demo = new Demo(1n, 2n);
                demo.setTag(tag);
                const txOutScript = demo.lockingScript.toHex();
                const { header, lockingScript } = ContractHeaderSerializer.deserialize(txOutScript);
                expect(header?.tag, 'tag should be same after deserialize when type is ' + typeStr).to.deep.equal(tag);
                expect(header?.md5).to.equals(exepctMd5)
                expect(lockingScript).to.equal((demo as any)._lockingScriptHexWithoutHeader);
            }
        })
    })

    it('should succeed if tag not set', () => {
        let demo: Demo = new Demo(1n, 2n);
        const txOutScript = demo.lockingScript.toHex()
        testUnlock(txOutScript, demo, (demo) => demo.add(3n))
    })
    it('should succeed if the tag is set', () => {
        let demo: Demo = new Demo(1n, 2n).setTag('')
        const txOutScript = demo.lockingScript.toHex()
        testUnlock(txOutScript, demo, (demo) => demo.add(3n))
    })
    it('should succeed if the utxo.script do not have header', () => {
        let demo: Demo = new Demo(1n, 2n);
        const txOutScript = (demo as any)._lockingScriptHexWithoutHeader
        testUnlock(txOutScript, demo, (demo) => demo.add(3n))
    })
    it('should override the tag is utxo.script have different header', () => {
        let demo: Demo = new Demo(1n, 2n).setTag('tag1')
        const txOutScript = demo.lockingScript.toHex()
        demo.setTag('tag2')
        const txOutScript2 = demo.lockingScript.toHex()
        testUnlock(txOutScript, demo, (demo) => {
            demo.add(3n)
            expect(demo.lockingScript.toHex()).to.equals(txOutScript)
            expect(demo.lockingScript.toHex()).to.not.equals(txOutScript2)
        })
    })


    function testUnlock(
        txOutScript: string,
        contract: Demo,
        unlockCall: (contract: Demo) => void,
    ) {
        const dummyUtxo = {
            ...getDummyUtxo(undefined, 1e5),
            script: txOutScript,
        }
        contract.bindToUtxo(dummyUtxo)
        const psbt = new ExtPsbt()
            .addContractInput(contract, (demo) => unlockCall(demo))
            .change(testAddress, 1)
            .seal()
            .finalizeAllInputs()
        expect(bvmVerify(psbt, 0)).to.be.true
    }

})